class Queue:
    # FIFO
    def __init__(self):
        self._queue = []

    def push(self, v):
        self._queue.append(v)

    def pop(self):
        self._queue.pop(0)

    def size(self):
        return len(self._queue)

    def peak(self):
        if len(self._queue) > 0:
            return self._queue[0]


def predictPartyVictory(senate: str) -> str:
    r = Queue()
    d = Queue()

    for i, letter in enumerate(senate):
        if letter == "R":
            r.push(i)
        if letter == "D":
            d.push(i)

    while r.size() > 0 and d.size() > 0:
        rfront = r.peak()
        dfront = d.peak()

        if rfront < dfront:
            r.push(rfront + len(senate))
        else:
            d.push(dfront + len(senate))

        r.pop()
        d.pop()

    if r.size() == 0:
        return "Dire"
    else:
        return "Radiant"


print(predictPartyVictory("RDD"))  # Dire
print(predictPartyVictory("RD"))  # Radiant

# breakpoint()
print(predictPartyVictory("DDRRR"))  # Dire

# breakpoint()
print(predictPartyVictory("DRDRR"))  # Dire

